column3:
V datoteki dinamicno.py (programiranje-1/12-dinamicno-programiranje/predavanja/dinamicno.py), se program stolpi(n) "zacikla". Za robni pogoj ni dovolj dati n == 0 ker ga v nekaterih primerih preskoči in gre v negativna števila. Sam sem robne primere spremenil v 
    if n == 0:
        return 1
    elif n < 0:
        return 0
in program deluje pravilno.

@mcafuta, naredil sem rebase commitov iz tvojega repozitorija in pridružil k zadnji delovni različici, tako da je v veji `vigenere` zadnja verzija, ki pa očitno še ne deluje, kot bi morala (zato tudi še nisem pridruževal v `devel`). Prosim te, da z delom nadaljuješ na tej veji (če imaš kakršnekoli težave ali vprašanja, se lahko kdaj dobiva, pa pogledava).

Po mojem lahko abecedo nad besedilom odstraniš, saj se lahko ista črka v ključu pojavi večkrat (in tako odpade funkcionalnost "katere črke še imamo"). Seveda bo na koncu potrebno povezati še z bazo, ampak najprej naj deluje s statičnimi besedili.

Predlagam, da s @Krucifiks pogledata, kaj od njegove kode se da uporabiti tudi za Vigenèrejevo šifro (skupno kodo se potem morda lahko premakne v npr. `static/js/common`), in pa poenotita izgled.
